import React from "react";
import {
	H1,
	Content,
	Button,
	Text,
	H3,
	Grid,
	Col,
	Row,
	Icon,
	Card,
} from "native-base";
import LoginForm from "@components/forms/Login";
import { StyleSheet } from "react-native";
import { loginGoogle, loginFacebook } from "@configs/fire/auth";
import styled from "styled-components/native";

const Area = styled.View`
	flex: 1;
	padding: 1%;
	flex-direction: column;
	background-color: white;
	justify-content: center;
	align-content: flex-start;
`;
const WelcomeText = styled.View`
	align-self: flex-start;
`;

WelcomeText.HeadLine = styled.Text`

`;

WelcomeText.Subtitle = styled.Text`

`;
const FormArea = styled.View`

`;


const Login: React.FC = () => {

	const onPress = (type: "google" | "facebook") => {
		if (type === "google") loginGoogle().catch((_e) => alert(_e));
		else loginFacebook().catch((_e) => alert(_e));
	};

	return (
		<Area>
			<WelcomeText>
				<WelcomeText.HeadLine> Bem vindo</WelcomeText.HeadLine>
				<WelcomeText.Subtitle> Acesse sua conta</WelcomeText.Subtitle>
			</WelcomeText>
			<Card>
				<FormArea>
					<LoginForm />
					<Button dark transparent>
						<Text>Esqueceu a senha?</Text>
					</Button>
					<Text>Ou acesse com sua conta:</Text>
					<Button
						iconLeft
						bordered
						full
						onPress={() => onPress("facebook")}
					>
						<Icon name="logo-facebook"></Icon>
					</Button>
					<Button
						iconLeft
						bordered
						full
						onPress={() => onPress("google")}
					>
						<Icon  name="logo-google"></Icon>
					</Button>
				</FormArea>
			</Card>
		</Area>
	);
};

const styles = StyleSheet.create({
	title: {
		fontWeight: "bold",
		fontSize: 40,
		paddingTop: 30,
	},
	card: {
		padding: 10
	},
	button: {
		fontStyle: "italic",
		textDecorationLine: "underline",
	},
	underline: {
		textAlign: "center",
		paddingVertical: 10
	}
});


export default Login;
